// import React from 'react';
import { createRoot } from 'react-dom/client';
// import ReactDOM from 'react-dom/client';
// import ReactDOM from 'react-dom';
import Header from '../components/Header'
import Footer from '../components/Footer'
import Image1 from '../images/200x300.png'
//import additional images later


function PortfolioSection() {
    return (
        <div>
            <div style={navStyle}>
                <div>
                    <img src={Image1} alt="Image 1 " /><br />
                    <a href="">Video Demo</a><br />
                    <a href="">GitHub Repo</a>
                </div>
                <div>
                    <img src={Image1} alt="Image 2 " /><br />
                    <a href="">Video Demo</a><br />
                    <a href="">GitHub Repo</a>
                </div>
                <div>
                    <img src={Image1} alt="Image 3 " /><br />
                    <a href="">Video Demo</a><br />
                    <a href="">GitHub Repo</a>
                </div>
            </div>

            <div>
                <div>
                    <img src={Image1} alt="Image 4 " /><br />
                    <a href="">Video Demo</a><br />
                    <a href="">GitHub Repo</a>
                </div>
                <div>
                    <img src={Image1} alt="Image 5 " /><br />
                    <a href="">Video Demo</a><br />
                    <a href="">GitHub Repo</a>
                </div>
                <div>
                    <img src={Image1} alt="Image 6 " /><br />
                    <a href="">Video Demo</a><br />
                    <a href="">GitHub Repo</a>
                </div>
            </div>
        </div>
    )
}

const navStyle = {
    display: 'flex', // Example: Setting the display property to flex
    justifyContent: 'center', // Example: Center the content horizontally
    background: 'blue',
    // Add more styles as needed
};

export default function MyPortfolio() {
    return (
        <>
        <Header />
        <PortfolioSection />
        <Footer />
        </>
    )
}

